MongoDB aggregate fill/replace array of ObjectId<p>I have the following MongoDB structure:</p>

<pre><code>campaign:{
  _id: '5e4eee638552043e60e5073b',
  name: 'Test campaign',
  partners: [
    {
      _id: '5e4fa9fbbdeb4a5878ac2a35',
      options: [Object],
      partner: '5e4e9bc2101ecb2e8764190c',
    },
    {
      _id: '5e4ff7c6e54b6d676d97b7a6',
      options: [Object],
      partner: '5e4ff51c23f44266a8add39e',
    }
  ]
}
</code></pre>

<p>Using the following <code>aggregate</code> function, I can lookup the ID of each of the partners and add to a new array:</p>

<pre><code>{
  $lookup:
  {
    from: 'campaigns',
    let: { campaign: '$campaign' },
    pipeline: [
      { $match: { $expr: { $and: [{ $eq: ['$_id', '$$campaign'] }] } } },
      {
        $lookup:
          {
            from: 'partners',
            let: { partner: '$partner.partner' },
            pipeline: [
              { $match: { $expr: { $in: ['$_id', '$$partner'] } } },
              { $project: { _id: 1, name: 1 } }
            ],
            as: 'partner1'
          }
        },
        {
          $project: {
            _id: 1, shortName: 1, userInterface: 1, options: 1, check: 1, description: 1, partner: 1, partner1: 1 } }
    ],
    as: 'campaign'
  }
}
</code></pre>

<p>This is new output:</p>

<pre><code>campaign: {
  _id: '5e4eee638552043e60e5073b',
  name: 'Test campaign',
  partners: [
    ...
  ],
  partner1: [
    { _id: '5e4e9bc2101ecb2e8764190c', name: '123' },
    { _id: '5e4ff51c23f44266a8add39e', name: '456' }
  ]
}
</code></pre>

<p>But what I want to do is have the <code>_id</code> of each element in partner array be replaced with the full partner object.</p>

<p>Partner object:</p>

<pre><code>partner
{ 
  _id: '5e4e9bc2101ecb2e8764190c',
  name: '123',
  etc: ...
},
{
  _id: '5e4ff51c23f44266a8add39e',
  name: '456'
  etc: ...
}
</code></pre>

<p>This is what the final object should look like:</p>

<pre><code>[
  {
    "campaign": [
      {
        "partner": [
          {
            "_id": "5e4eee638552043e60e5073b",
            "options": [
              {}
            ],
            "partner": {
                "_id": "5e4e9bc2101ecb2e8764190c",
                "name": "123"
            }
          }
        ]
      }
    ]
  }
]
</code></pre>

