Upsert a document with value from filter<p>I have a collection with following structure in MongoDB:</p>

<pre><code>{
  "userId": String,
  "refs": Set&lt;String&gt;
}
</code></pre>

<p>I need to update the collections with those documents. I want to add to <code>refs</code> a new string, for users that are in the filter <code>$in</code>.
But, if the user is not exists I need to "upsert" him.</p>

<p>In code (golang) it looks like this:</p>

<pre class="lang-golang prettyprint-override"><code>filter := bson.M{
    "userId": bson.M{
        "$in:": tokens // tokens is []string
    }
}

update := bson.M{
    "$addToSet": bson.M{
        "refs": newReference
    }
}

ctx, _ := newDbOperationContext()
_, err := driver.UpdateMany(ctx, filter, update)
</code></pre>

<p>So, for existing users it works ok, the reference is added. But, for users that not exists nothing happen.</p>

<p>I set in <code>driver.UpdateMany(bson, bson, opts...)</code> opts to <code>options.UpdateOptions.SetUpsert(true)"</code>, but as a result I got a document without userId:</p>

<pre><code>{
  "_id": ObjectId("..."),
  "refs": ["new_reference"]
}
</code></pre>

<p>So, my question is, how to upsert the new values with <code>userId</code> field.</p>

<p>The scale is like 2*10^6 users to update, so I would like to do that using batch request. Creating using "one by one" and updating him is not an option here, I think.</p>

<p>Thanks for your support!</p>

