Multiple find results handling<p>I am storing users and treating them as the center of the universe in my application, i am now trying to introduce the concept of an Org whereby users can be a member of many Orgs and then certain settings etc will belong to the Org. The function I am trying to create is to search for all Orgs where the users ID can be found and either the Owner or one of the Members and return a list of Orgs to then render the details client-side.</p>

<p>The issue I am having relates to the handling and conversion of results from the Mongo Find and then how to handle that and convert to a format I can return safely at the end.</p>

<p>Currently im unable to return the data with the error</p>

<blockquote>
  <p>cannot use &amp;org (value of type *[]*model.Org) as *model.Org value in
  return statement</p>
</blockquote>

<p><strong>Org Model</strong></p>

<p>package model</p>

<pre><code>// Org is the structure of a org
type Org struct {
    ID          string   `json:"id" bson:"_id"`
    Name        string   `json:"name" bson:"name"`
    Owner       string   `json:"owner" bson:"owner"`
    Members     []string `json:"members" bson:"members"`
    Token       string   `json:"token" bson:"-"`
    VerifyToken string   `json:"verifyToken" bson:"verifyToken"`
}
</code></pre>

<p><strong>Function</strong></p>

<pre><code>// GetOrgByUserID returns a user by his id
func (db *DB) GetOrgByUserID(id string) (*model.Org, error) {
    findOptions := options.Find()

    var org []*model.Org

    cur, err := db.collections.orgs.Find(context.TODO(), bson.D{{"owner", id}}, findOptions)
    if err != nil {
        return nil, err
    }
    // Iterate through the cursor
    for cur.Next(context.TODO()) {
        var elem model.Org
        err := cur.Decode(&amp;elem)
        if err != nil {
            return nil, err
        }

        org = append(org, &amp;elem)
    }

    if err := cur.Err(); err != nil {
        return nil, err
    }
    // Close the cursor once finished
    cur.Close(context.TODO())

    return &amp;org, nil
}
</code></pre>

